import './landing.scss';

import TextBlock from '../textBlock/textBlock';
import Image1 from './landing.jpg';
import Services from '../services/services';
import LetsTalk from '../letsTalk/letsTalk';

const Landing = (): JSX.Element => {

    const title1: JSX.Element = <span key="title1_1">Your partner for digital solutions</span>;
    const text1: JSX.Element = <span key="text1_1">A digital agency based in the Netherlands</span>;

    return (
        <div className="landing">
            <TextBlock title={title1} text={text1} />
            <img className="landing__image1" src={Image1} />
            <Services />
            <LetsTalk />
        </div>
    );
}

export default Landing;
